Artist: Black Box
Album: Dreamland (Debut album)
Genre: Disco (House)
Year: 1990
Format: LAME MP3
Quality: 320 kbps, CBR

Dreamland was the debut album of Italo house band Black Box. It was released in May 1990, and was preceded in 1989 by the international hit single, &quot;Ride On Time.&quot; The album was certified gold in both the U.S. and the U.K. Album reached #1 Australia, #8 Norway, #14 UK, #57 US, #36 Germany.

